INSERT INTO `Elemento` VALUES (1,'ACT','1','Líder de análisis','Es el analista encargado de un proyecto.',5,1),(2,'ACT','2','Analista','Es el encargado de documentar los elementos que componen el proyecto.',5,1),(3,'ACT','3','Administrador','Es la persona encargada de registrar los proyectos y al personal de la organización.',5,1),(4,'ENT','1','Elemento','Esta entidad engloba a varias otras entidades, es una generalización de caso de uso, pantalla, mensaje, regla de negocio, término del glosario, actor y entidad.',5,1),(5,'ENT','2','Actor','Se refiere a los roles de los usuarios en el sistema.',5,1),(6,'GLS','1','Cardinalidad','Es el número de actores que participarán o serán requeridos en el sistema.',5,1),(7,'RN','12','Identificador de elemento','El identificador de cada elemento se compone de un nombre, número y una clave. \n	Donde el nombre es el que le asigna el usuario, el número es secuencial y la clave define el tipo de elemento: \"ENT\" para las entidades, \"ACT\"\" para los actores, \"CU\" para los casos de uso, \"IU\" para\n    las pantallas, \"MSG\" para los mensajes, \"RN\" para las reglas de negocio y \"GLS\" para los términos del glosario.',5,1),(8,'RN','8','Datos obligatorios','El usuario debe ingresar toda la información marcada como obligatoria en el modelo conceptual.',5,1),(9,'RN','60','Unicidad de nombres de actor','El nombre de los elementos del mismo tipo no puede repetirse.',5,1),(10,'RN','61','Nombre del actor','Los nombres de los elementos no pueden contener coma, punto, punto medio, dos puntos o guión bajo.',5,1),(11,'RN','62','Tipo de dato correcto','La información que el usuario proporcione, debe ser del tipo definido en el modelo conceptual.',5,1),(12,'RN','63','Longitud correcta','La información que el usuario proporcione, debe cumplir con la longitud definida en el modelo conceptual.',5,1),(13,'MSG','1','Operación exitosa','Notificar al actor que la operación se ha realizado de forma exitosa.',5,1),(14,'MSG','4','Dato obligatorio','Notificar al actor que el dato es obligatorio.',5,1),(15,'MSG','5','Dato incorrecto','Notificar al actor que el dato no tiene el formato solicitado.',5,1),(16,'MSG','6','Longitud inválida','Notificar al actor que el dato no cumple con la longitud solicitada.',5,1),(17,'MSG','7','Registro repetido','Notificar al actor que el nombre del elemento ya existe.',5,1),(18,'MSG','23','Caracteres inválidos','Informar al actor que el dato que ingresó no puede contener coma, punto, punto medio, dos pufTntos o guión bajo.',5,1),(19,'IUE','7','Gestionar actores','En esta pantalla el actor puede visualizar algunos atributos de los actores y las operaciones disponibles de acuerdo a si está relacionado a un caso de uso liberado.',5,1),(20,'IUE','7.1','Registrar actor','Esta pantalla permite al actor registrar la información de un actor nuevo.',5,1),(21,'CUE','7.1','Registrar actor','Un actor es un rol que va a interactuar con el sistema. Este caso de uso permite al analista registrar un actor',5,1),(22,'MSG','13','Ha ocurrido un error','Informar al actor que no es posible realizar la operación debido a que ha ocurrido un error inesperado en el sistema.',5,1),(23,'RN','20','Verificación de catálogos','Es necesario que exista información registrada en los catálogos al momento de solicitar una operación que requiera estos.',5,1),(29,'ENT','','Módulo','Se refiere a los segmentos en que se dividen los proyectos.',5,1),(30,'CUE','7','Gestionar actores','Este caso de uso permite al analista visualizar los registros de los actores registrados en el sistema. También permiteal actor acceder a las operaciones de registro, consulta, modificación, y eliminación de un actor.',5,1),(31,'MSG','2','No existe información','Notificar al actor que aún no existe información registrada en el editor.',5,1),(32,'IUE','4','Gestionar proyectos','En esta pantalla el actor puede visualizar algunos atributos de los proyectos y las operaciones disponibles de acuerdo su estado.',5,1),(33,'IUE','3','Gestionar módulos','En esta pantalla el actor puede visualizar algunos atributos de los módulos registrados y las operaciones disponibles de gestión.',5,1),(34,'IUE','3.4','Menú principal','Este menú muestra los elementos que se pueden gestionar y que no están asociados a un módulo.',5,1),(36,'ENT','','Colaborador','Se refiere al participante de un proyecto.',5,1),(37,'MSG','31','Correo electrónico y/o contraseña incorrectos','Informar al actor que no es posible iniciar sesión debido a que su correo electrónico y/o contraseña son incorrectos.',5,1),(38,'IUE','13','Iniciar sesión','Esta pantalla permite al actor iniciar sesión en el sistema.',5,1),(39,'CUE','13','Iniciar sesión','Este caso de uso permite al actor iniciar sesión en el sistema.',6,1),(40,'ENT','','Proyecto','Idea de una cosa que se piensa hacer y para la cual se establece un modo determinado y un conjunto de medios necesarios.',5,1),(41,'CUE','4','Gestionar proyectos','Este caso de uso permite al analista visualizar los registros de los proyectos.',5,1),(42,'CUE','1','Gestionar proyectos de Administrador','Este caso de uso permite al Administrador visualizar todos los proyectos, así como solicitar el registro, modificación y eliminación de un proyecto.',6,1),(43,'IUE','1','Gestionar proyectos de administrador','En esta pantalla el actor puede visuallizar algunos atributos de los proyectos y las operaciones disponibles de acuerdo a su estado.',5,1),(44,'IUE','1.4','Menú principal del administrador','Menú que contiene las opciones disponibles del administrador.',5,1),(45,'IUE','2','Gestionar personal','En esta pantalla el actor puede visualizar algunos atributos de las personas registradas y las operaciones disponiblesde gestión.',5,1),(46,'IUE','2.1','Registrar persona','Esta pantalla permite al actor registrar la información de una persona.',5,1),(47,'CUE','2','Gestionar personal','Este caso de uso permite al Administrador visualizar todas las personas de la organización, así como solicitar el registro, consulta, modificación y eliminación de una persona.',6,1),(48,'CUE','2.1','Registrar persona','Este caso de uso permite registrar la información de una persona que podrá ser elegida como colaborador de un proyecto.',7,1),(49,'RN','64','Unicidad de CURP','No puede existir más de una persona con la misma clave CURP.',5,1),(50,'MSG','34','Datos de sesión','Proporcionar al usuario sus datos para iniciar sesión.',5,1);
