INSERT INTO `ReglaNegocio` VALUES (7,'El identificador de cada elemento se compone de un nombre, número y una clave. \n	Donde el nombre es el que le asigna el usuario, el número es secuencial y la clave define el tipo de elemento: \"ENT\" para las entidades, \"ACT\"\" para los actores, \"CU\" para los casos de uso, \"IU\" para\n    las pantallas, \"MSG\" para los mensajes, \"RN\" para las reglas de negocio y \"GLS\" para los términos del glosario.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(8,'El usuario debe ingresar toda la información marcada como obligatoria en el modelo conceptual.',4,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(9,'El nombre de los elementos del mismo tipo no puede repetirse.',3,4,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(10,'Los nombres de los elementos no pueden contener coma, punto, punto medio, dos puntos o guión bajo.',9,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,'[^,._·:]*$'),(11,'La información que el usuario proporcione, debe ser del tipo definido en el modelo conceptual.',6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(12,'La información que el usuario proporcione, debe cumplir con la longitud definida en el modelo conceptual.',5,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(23,'Es necesario que exista información registrada en los catálogos al momento de solicitar una operación que requiera estos.',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(49,'La clave CURP del personal debe ser única.',3,11,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'');
/*!40000 ALTER TABLE `ReglaNegocio` ENABLE KEYS */;
UNLOCK TABLES;

